As an experiment, I created constraints I couldn't satisfy and tried to install locally and was greeted with this dialog.

![screen shot 2016-10-19 at 2 36 52 pm](https://cloud.githubusercontent.com/assets/67586/19538616/be450c68-9609-11e6-9b16-4fe63c33aacf.png)

@alexander-doroshko : do you know how this looks when you try and install from a plugin repository?  Is there anything we can do to improve the messaging?

OK.  Thanks.  This is something we should investigate and weigh our options.

@mit-mit I'm curious if you have a feeling with respect to user experience.  Some options:
1. add a constraint to `plugin.xml` that ensures the plugin cannot be installed on a stale version of the IDE.  Pro: no inconsistencies like reported here; CON: poor discoverability --- if I try and install Flutter and don't see it listed will I be confused?  Will I have any idea what to do?  (In this case update IDEA.)
2. handle this version checking programmatically.  PRO: we can control messaging; CON: we have to control messaging, if users ignore it, they live with an incompatible plugin.

@alexander-doroshko : besides this [blog post](https://blog.jetbrains.com/idea/2008/03/enterprise-plugin-repository/) (from 2008), can you point me to any documentation?  I found this [external post](http://2016.8-p.info/post/04-25-idea-plugins/) but it doesn't add much and isn't really authoritative.  It'd be great to know more about our options.

@mit-mit 
External devs should be nudged to move over to 2016.2.x

2016.1.1 did have the security bug (https://blog.jetbrains.com/idea/2016/05/important-security-update-for-intellij-idea-2016-1-and-older-versions/)- best to move everyone over to 2016.2 proper.
